#!/bin/bash
set -e
echo "============================================================"
echo " OneTwo Deploy v7f — Community Room + Resident Fiscal Lens"
echo "============================================================"
echo ""
echo "Changes:"
echo "  NEW: Community Room (/community) — resident-facing"
echo "    Tabs: Meetings | Votes & Resolutions | Report Issues"
echo "  Resident nav: Dashboard | Community Room | The Building | Fiscal Lens | Archives"
echo "  Board Room removed from resident nav"
echo "  Fiscal Lens added for residents"
echo ""
cd "$(dirname "$0")/.."
mkdir -p src/features/boardroom src/features/elections src/features/dashboard src/features/compliance src/features/issues src/features/community src/store src/lib
\necho "[1/11] src/App.tsx"\nbase64 -d << 'EOF_1' > src/App.tsx\\nEOF_1\n\necho "[2/11] vercel.json"\nbase64 -d << 'EOF_2' > vercel.json\\nEOF_2\n\necho "[3/11] src/features/boardroom/BoardRoomPage.tsx"\nbase64 -d << 'EOF_3' > src/features/boardroom/BoardRoomPage.tsx\\nEOF_3\n\necho "[4/11] src/features/elections/ElectionsPage.tsx"\nbase64 -d << 'EOF_4' > src/features/elections/ElectionsPage.tsx\\nEOF_4\n\necho "[5/11] src/features/dashboard/DashboardPage.tsx"\nbase64 -d << 'EOF_5' > src/features/dashboard/DashboardPage.tsx\\nEOF_5\n\necho "[6/11] src/store/useMeetingsStore.ts"\nbase64 -d << 'EOF_6' > src/store/useMeetingsStore.ts\\nEOF_6\n\necho "[7/11] src/lib/complianceRefresh.ts"\nbase64 -d << 'EOF_7' > src/lib/complianceRefresh.ts\\nEOF_7\n\necho "[8/11] src/lib/rolePermissions.ts"\nbase64 -d << 'EOF_8' > src/lib/rolePermissions.ts\\nEOF_8\n\necho "[9/11] src/features/compliance/CompliancePage.tsx"\nbase64 -d << 'EOF_9' > src/features/compliance/CompliancePage.tsx\\nEOF_9\n\necho "[10/11] src/features/issues/IssuesPage.tsx"\nbase64 -d << 'EOF_10' > src/features/issues/IssuesPage.tsx\\nEOF_10\n\necho "[11/11] src/features/community/CommunityRoomPage.tsx"\nbase64 -d << 'EOF_11' > src/features/community/CommunityRoomPage.tsx\\nEOF_11\n
echo ""
echo "Building..."
npm run build
if [ $? -eq 0 ]; then
  echo ""
  echo "BUILD SUCCESSFUL"
  echo "  git add -A && git commit -m 'v7f: community room for residents' && git push"
  echo "  Clear localStorage after deploy"
else
  echo "BUILD FAILED"; exit 1
fi
